chunks.text:
Headers:

* `Authorization: Bearer …`
* `Idempotency-Key: <key>`

Body:

```json
{
  "customerId": "cus_123",
  "currency": "JPY",
  "items": [
    { "sku": "SKU-001", "quantity": 2, "unitPrice": 1200 }
  ]
}
```

* `201 Created`

```json
{
  "orderId": "ord_abc",
  "status": "PENDING",
  "totalAmount": 2400,
  "currency": "JPY",
  "createdAt": "2025-12-01T10:00:00Z"
}
```

* `409 Conflict`（冪等性衝突）

```json
{
  "error": {
    "code": "IDEMPOTENCY_CONFLICT",
    "message": "同じIdempotency-Keyが異なるリクエストボディで再利用されました。"
  }
}
```

```json
{ "status": "PAID" }
```

全てのエラーは以下の形式：

```json
{
  "error": {
    "code": "SOME_CODE",
    "message": "人間が読める説明"
  }
}
```
